import React, { useState, useEffect } from "react";

export default function Contact() {
  const [form, setForm] = useState({ name: "", email: "", message: "" });
  const [errors, setErrors] = useState({});
  const [touched, setTouched] = useState({}); // track fields touched for nicer UX
  const [isValid, setIsValid] = useState(false);

  // Validation rules
  const validate = (values) => {
    const newErrors = {};
    if (!values.name.trim()) newErrors.name = "Name is required";
    if (!values.email.trim()) {
      newErrors.email = "Email is required";
    } else if (!/^\S+@\S+\.\S+$/.test(values.email)) {
      newErrors.email = "Enter a valid email";
    }
    if (!values.message.trim()) {
      newErrors.message = "Message is required";
    } else if (values.message.trim().length < 10) {
      newErrors.message = "Message must be at least 10 characters";
    }
    return newErrors;
  };

  // Live-validate whenever form changes
  useEffect(() => {
    const newErrors = validate(form);
    setErrors(newErrors);
    setIsValid(Object.keys(newErrors).length === 0);
  }, [form]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleBlur = (e) => {
    const { name } = e.target;
    setTouched((prev) => ({ ...prev, [name]: true }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newErrors = validate(form);
    setErrors(newErrors);
    setTouched({ name: true, email: true, message: true });

    if (Object.keys(newErrors).length) return; // stop submit if invalid

    // Successful submit logic
    alert("Message sent!");
    setForm({ name: "", email: "", message: "" });
    setTouched({});
    setErrors({});
  };

  // helper for input classes: red border when there's an error and field touched (or always show if you prefer)
  const inputClass = (field) =>
    `border rounded-xl px-10 py-2.5 focus:outline-none ${
      errors[field] && touched[field] ? "border-red-500 ring-1 ring-red-200" : "border-gray-300"
    }`;

  return (
    <div className="page">
      <div className="max-w-xl card mx-auto">
        <h2 className="text-2xl font-semibold mb-4">Contact Us</h2>

        <form className="grid gap-3" onSubmit={handleSubmit} noValidate>
          {/* NAME */}
          <div>
            <input
              className={inputClass("name")}
              name="name"
              placeholder="Your Name"
              value={form.name}
              onChange={handleChange}
              onBlur={handleBlur}
              aria-invalid={!!errors.name}
              aria-describedby={errors.name ? "name-error" : undefined}
            />
            {errors.name && touched.name && (
              <p id="name-error" className="text-red-500 text-sm mt-1">
                {errors.name}
              </p>
            )}
          </div>

          {/* EMAIL */}
          <div>
            <input
              className={inputClass("email")}
              name="email"
              type="email"
              placeholder="Email"
              value={form.email}
              onChange={handleChange}
              onBlur={handleBlur}
              aria-invalid={!!errors.email}
              aria-describedby={errors.email ? "email-error" : undefined}
            />
            {errors.email && touched.email && (
              <p id="email-error" className="text-red-500 text-sm mt-1">
                {errors.email}
              </p>
            )}
          </div>

          {/* MESSAGE */}
          <div>
            <textarea
              className={inputClass("message")}
              rows="4"
              name="message"
              placeholder="Message"
              value={form.message}
              onChange={handleChange}
              onBlur={handleBlur}
              aria-invalid={!!errors.message}
              aria-describedby={errors.message ? "message-error" : undefined}
            />
            {errors.message && touched.message && (
              <p id="message-error" className="text-red-500 text-sm mt-1">
                {errors.message}
              </p>
            )}
          </div>

          {/* SUBMIT */}
          <button
            className={`btn btn-primary py-2 rounded-xl disabled:opacity-60 disabled:cursor-not-allowed`}
            type="submit"
            disabled={!isValid}
            aria-disabled={!isValid}
          >
            Send Message
          </button>
        </form>
      </div>
    </div>
  );
}
